import React from 'react';
import './Counter.css';

const Counter = () => {
  const onClickHandler = () => {
    alert('Change')
  }

  return (
    <div className='counter'>
      <button onClick = {onClickHandler}>-</button>
      <div>0</div>
      <button onClick = {onClickHandler}>+</button>
    </div>
  )
}

export default Counter;
